import React from 'react';
import NavBar from './NavBar';
import pic from '../pictures/IMG_0440.jpeg';

const Home = () => {

  return (
    <>
    <NavBar/>
    <div className="top-image" id="home">
        <span>Erik Tveraaen Torvbråten</span>
        <img src={pic} alt="Logo" style={{width:"100%"}}/>
    </div>


      <div className="intro">
        <h1 className='header'>Erik Tveraaen Torvbråten</h1>
        <p id="introParagraph">I am a 22 year old man from Asker Norway. Currently I am on my third year of a 
          MSc degree in computer science at the norwegian university of science and technology NTNU.
          </p>
        <img src={pic} alt="Logo" className="pic"/>
      </div>
    </>
  );
}

export default Home;
